function createInterface(field) {
	obj = {
		name: field.key, 
		label: field.label
	}
	if (field.key === "id" || field.key === "formId" || field.key === "formName" || field.key === "respondentId" || field.key === "createdAt")
		return undefined;
	switch (field.type) {
		case "string":
			obj.type = "text";
			break;
		case "boolean":
			obj.type = "boolean";
			break;
		case "number":
			obj.type = "number";
			break;
		case "datetime":
			obj.type = "date";
			break;
		default:
			obj.type = "text";
	}

	return {
		name: obj.name,
		label: obj.label,
		type: obj.type    
	};
}

createMatrixSpec.code:
function createMatrixSpec(field) {
    let {value, rows} = field;
    const specArray = [];
    if (value){
        for (let [key] of Object.entries(value)) {
            const specObj = {};
            specObj.name = rows.find(item => item.id === key).id;
            specObj.type = 'array';
            specObj.label = rows.find(item => item.id === key).text;
            specArray.push(specObj);
        }
    }
    return specArray;
}

