    const body = { eventId: '6ce9a746-9bef-421b-910a-2839990bfbf8', eventType: 'FORM_RESPONSE' };

    assert.deepStrictEqual(transformWebhookBody(body), body);
});

it('should return input if input does not contain eventId', () => {
    const body = { eventType: 'FORM_RESPONSE', data: { responseId: '7Wr4D2' } };

    assert.deepStrictEqual(transformWebhookBody(body), body);
});

it('should return input if data is not an object', () => {
    const body1 = { 
