function transformWebhookPayload(payload) {
	if (!payload.fields) return payload
	let fieldsById = {}

    const newFields = {}
    for (let field of payload.fields) {
        let { key, label, type, value, options, columns, rows} = field
		const name = label ? label : `${key} (${type})`;
		const nameById = key;
        if (type === 'RANKING'){
            if (Array.isArray(value)){
                value.forEach(function(valItem, index) {
                  this[index] = options.find(item => item.id === valItem).text;
                }, value)
            }
            fieldsById[nameById] = value
            newFields[name] = value
            continue;
        }
        if (type === 'MATRIX'){
            if (value){
                for (const [key, val] of Object.entries(value)) {
                    val.forEach(function(valItem, index) {
                      this[index] = columns.find(item => item.id === valItem).text;
                    }, val)
                }
            }
            fieldsById[nameById] = value
            newFields[name] = value
            continue;
        }
        if (options) {
            if (Array.isArray(value)) {
                const newValue = options.reduce((acc, item) => {
                    if (value.includes(item.id)) {
                        return [...acc, item.text]
                    }
                    return acc
                }, [])
                newFields[name] = newValue
                fieldsById[nameById] = newValue
				continue;
            } else {
                const valueFound = options.find(item => item.id === value)
                newFields[name] = valueFound ? valueFound.text : valueFound
                fieldsById[nameById] = valueFound ? valueFound.text : valueFound
				continue;
            }
        }
		fieldsById[nameById] = value
        newFields[name] = value
    }
	payload.fieldsById = fieldsById
    payload.fields = newFields
    return payload;
}

